import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import Root_layout from './Components/RootLayout/RootLayout';
function App() {

  let router = createBrowserRouter([{
    path:'',
    element: <Root_layout/>,
   }])
  return (
    <div className="App">
        <RouterProvider router={router} />
    </div>
  );
}

export default App;
